function Dashboard() {
  return (


        <div className="w-4/5 mx-auto  self-center h-48">
            <p className="text-white font-serif font-semibold text-2xl ">Mi nombre es Billy</p>
            <p className="font-bold text-white text-3xl">Creo paginas web y aplicaciones multiplataforma</p>
            <p className=" text-white text-3xl">Soy desarrollador fullstack de paginas web y programador de aplicaciones multiplataforma </p>
        </div>,

      <div className="w-40 p-2 flex mx-auto ">
        <button className="transition duration-150 ease-out py-2 px-4 border-2 border-greens text-black font-medium hover:-translate-y-1 bg-green hover:text-gray-50  ">
          Explorar
        </button>
      </div>

  );
}

export default Dashboard;
